import time

import requests as r
from PIL.WebPImagePlugin import Image
import base64

def convert_to_webp(original):
    converted = Image.open(original)
    path = original.split(".jpg")[0]
    output = path + ".webp"
    converted.save(output, "webp")
    with open(original, "rb") as image2string:
        converted_string = base64.b64encode(image2string.read())
    return converted_string


def convert_to_webp_and_save(original):
    converted = Image.open(original)
    path = original.split(".jpg")[0]
    output = path + ".webp"
    converted.save(output, "webp")
    with open(original, "rb") as image2string:
        converted_string = base64.b64encode(image2string.read())
    return output


def webp_to_string(path):
    with open(path, "rb") as image2string:
        converted_string = base64.b64encode(image2string.read()).decode('utf-8')
    return converted_string


