def check_progress(request_id):
    endpoint = f"https://stablehorde.net/api/v2/generate/check/{request_id}"

    headers = {"apikey": "hvKgnDdSlofSskGJP-qEJQ", "Content-Type": "application/json"}

    params = {
        "id": request_id
    }

    rep = r.get(url=endpoint, json=params, headers=headers)
    rep = rep.json()

    print("Remaining time : " + str(rep["wait_time"]) + " seconds")

    return rep["done"] == True


def fetch_result(request_id):
    endpoint = f"https://stablehorde.net/api/v2/generate/status/{request_id}"

    headers = {"apikey": "hvKgnDdSlofSskGJP-qEJQ", "Content-Type": "application/json"}

    params = {
        "id": request_id
    }

    rep = r.get(url=endpoint, json=params, headers=headers)
    rep = rep.json()

    # print("generated ", len(rep["generations"]), "images")

    return rep["generations"]


def run(prompt, path, mask_path, output_path):
    img_path = convert_to_webp_and_save(path)
    img_string = webp_to_string(img_path)
    mask_string = webp_to_string(mask_path)
    id = upload_image_with_mask(img_string, mask_string, prompt)
    done = check_progress(id)

    while not done:
        done = check_progress(id)
        time.sleep(0.5)

    results = fetch_result(id)

    for i, e in enumerate(results):
        img = e["img"]

        imgdata = base64.b64decode(img)
        filename = output_path  # I assume you have a way of picking unique filenames
        with open(filename, 'wb') as f:
            f.write(imgdata)


